general:
  name: tsObj
  short: 'migration: needs update'
  description: 'Photometric information used for calibration of the spectra, for the

    SDSS-I, -II data set (rerun 26). These should not be used as

    definitive photometric data (they do not even correspond necessarily

    to the DR7 photometric reductions). The best source for details on

    this file is at

    the <a href="http://www.sdss.org/dr7/dm/flatFiles/tsObj.html">DR7 flat

    file data model</a> .'
  datatype: FIT
  filesize: 3 MB
  releases:
  - DR8
  - DR9
  - DR10
  - DR12
  - DR11
  - DR13
  - DR14
  - DR15
  - DR16
  - DR17
  environments:
  - SPECTRO_REDUX
  naming_convention: tsObj-PLATE4-MJD5-PLUGGING.fit
  generated_by: 'migration: not in database. Needs update'
changelog:
  description: Describes changes to the datamodel product and/or file structure from
    one release to another
  releases:
    DR17:
      from: DR16
      note: No changes
    DR16:
      from: DR15
      note: No changes
    DR15:
      from: DR14
      note: No changes
    DR14:
      from: DR13
      note: No changes
    DR13:
      from: DR11
      note: No changes
    DR11:
      from: DR12
      note: No changes
    DR12:
      from: DR10
      note: No changes
    DR10:
      from: DR9
      note: No changes
    DR9:
      from: DR8
      note: No changes
